import * as React from "react";
import "../css/home.css";
import NavBar from "../dynamic/NavBar";


function Resources() {
  useEffect(() => {
    document.getElementById("cement")?.scrollIntoView({ behavior: "smooth" });
  }, []);

  const { scrollYProgress } = useScroll();
  

  

  return (
    <div id="homeContainer">
      <NavBar />
      
    </div>
  );
}

export default  Resources;
